	(1, 'Quienes somos', '<p><font color="#ffffff"><span data-metadata="<!--(figmeta)eyJmaWxlS2V5IjoiRFoySTlTS2VFQ1RobWdIa0hCT0ZkTSIsInBhc3RlSUQiOjc3MTgzNzU5LCJkYXRhVHlwZSI6InNjZW5lIn0K(/figmeta)-->"></span><span data-buffer="<!--(figma)(/figma)-->"></span><span style="white-space-collapse: preserve;">Real Química es una empresa de raíz electroquímica y su nombre original al comienzo de sus actividades fue Laboratorio Argentino de Investigación Galvanotécnica.<br><br>Fundada 1973, su principal objetivo fue el de llevar la avanzada en la investigación, el desarrollo, y la puesta en marcha de nuevas tecnologías para el tratamiento de superficies; manifestando una marcada vocación de para el desarrollo de la industria nacional.</span></font><br></p><p><span data-metadata="<!--(figmeta)eyJmaWxlS2V5IjoiRFoySTlTS2VFQ1RobWdIa0hCT0ZkTSIsInBhc3RlSUQiOjEwOTExMjg2MzEsImRhdGFUeXBlIjoic2NlbmUifQo=(/figmeta)-->"></span></p>', 'fotos/nR5rMb6rAsiUrcxyebSyqUYDtruUwwqyvCPEHfOx.png', 'undefined', 'undefined', 'home', '2024-05-29 18:54:22'),
	(2, 'Fasón', '<p><span data-metadata="<!--(figmeta)eyJmaWxlS2V5IjoiRFoySTlTS2VFQ1RobWdIa0hCT0ZkTSIsInBhc3RlSUQiOjE5OTQ5NjU5MjksImRhdGFUeXBlIjoic2NlbmUifQo=(/figmeta)-->"></span><span data-buffer="<!--(figma)(/figma)-->"></span><span style="white-space-collapse: preserve;">Poseemos una planta industrial que cuenta con modernas instalaciones, adecuadas para la fabricación de todo tipo de productos químicos.<br>Reactores en acero inoxidable y fibra de vidrio, desde 3500, con agitación y posibilidades para el calentamiento y/o enfriamiento.<br><br>Las alternativas de trabajo para la fabricación por orden de terceros se adecuan a las necesidades de cada cliente y pueden incluir, no sólo la fabricación, sino también la provisión de materias primas, el servicio de depósito, la logística para las entregas, los controles de laboratorio.<br>Todo nuestro servicio de fasón está contemplado en nuestro sistema de calidad y gestión ambiental.</span><br><span data-metadata="<!--(figmeta)eyJmaWxlS2V5IjoiUzh4cFJxSmNsY3pDWGNRcFo0ckQxbSIsInBhc3RlSUQiOjY5NzU5NDIxOCwiZGF0YVR5cGUiOiJzY2VuZSJ9Cg==(/figmeta)-->"></span></p>', 'fotos/B9v6U0HzVbJXU69Atn93CyY5F02nC7W6EYr6kSfY.png', 'undefined', 'undefined', 'servicio1', '2024-05-29 19:02:38'),
	(3, 'Formulación y Desarrollo de producto', '<p><span data-metadata="<!--(figmeta)eyJmaWxlS2V5IjoiRFoySTlTS2VFQ1RobWdIa0hCT0ZkTSIsInBhc3RlSUQiOjc4NDczODY2OCwiZGF0YVR5cGUiOiJzY2VuZSJ9Cg==(/figmeta)-->"></span><span data-metadata="<!--(figmeta)eyJmaWxlS2V5IjoiRFoySTlTS2VFQ1RobWdIa0hCT0ZkTSIsInBhc3RlSUQiOjE2NjY4MDczODgsImRhdGFUeXBlIjoic2NlbmUifQo=(/figmeta)-->"></span><span data-buffer="<!--(figma)(/figma)-->"></span><span style="white-space-collapse: preserve;">El departamento ejecuta tareas relacionadas con el apoyo técnico y <br>da asesoramiento sobre las características, usos, pruebas y puesta <br>en marcha de cada unos de los producto que sean utilizados por nuestros clientes.<br><br>Los clientes pueden ponerse en contacto con nuestro departamento de Asistencia Técnica "cuando lo consideren necesario" y recibirán asistencia continua hasta la resolución del problema.</span><br></p>', 'fotos/JvRCk7zuIIzot2h8WMk7XIF2ZuRgPUtASbqFLpOo.png', 'undefined', 'undefined', 'servicio2', '2024-05-29 19:03:48'),
	(4, 'Sobre nosotros', '<p><span data-metadata="<!--(figmeta)eyJmaWxlS2V5IjoiRFoySTlTS2VFQ1RobWdIa0hCT0ZkTSIsInBhc3RlSUQiOjMxMzMxNzUwLCJkYXRhVHlwZSI6InNjZW5lIn0K(/figmeta)-->"></span><span data-buffer="<!--(figma)(/figma)-->"></span><span style="white-space-collapse: preserve;">Real Quimica es una empresa de raíz electroquímica y su nombre original al comienzo de sus actividades fue Laboratorio Argentino de Investigación Galvanotécnica.<br>Fundada 1973, su principal objetivo fue el de llevar la avanzada en la investigación, el desarrollo, y la puesta en marcha de nuevas tecnologías para el tratamiento de superficies; manifestando una marcada vocación de para el desarrollo de la industria nacional.<br><br>La innovación tecnológica, la responsabilidad social, la sustentabilidad ambiental y un decidido compromiso en búsqueda de la excelencia para la implementación de sus procesos son las premisas que nos guían.</span><br><span data-metadata="<!--(figmeta)eyJmaWxlS2V5IjoiRFoySTlTS2VFQ1RobWdIa0hCT0ZkTSIsInBhc3RlSUQiOjE4NDQyMDIxODUsImRhdGFUeXBlIjoic2NlbmUifQo=(/figmeta)-->"></span></p>', 'fotos/TsaaDKcmaS0oAiE8WJKmKhKqMZtkLEFLk9rHoMF4.png', 'undefined', 'undefined', 'nosotros', '2024-05-29 18:53:46'),
	(5, 'Laboratorio de calidad', '<p><span data-metadata="<!--(figmeta)eyJmaWxlS2V5IjoiRFoySTlTS2VFQ1RobWdIa0hCT0ZkTSIsInBhc3RlSUQiOjkzMTk3OTMwLCJkYXRhVHlwZSI6InNjZW5lIn0K(/figmeta)-->"></span><span data-metadata="<!--(figmeta)eyJmaWxlS2V5IjoiRFoySTlTS2VFQ1RobWdIa0hCT0ZkTSIsInBhc3RlSUQiOjk1MDg1NjYwNSwiZGF0YVR5cGUiOiJzY2VuZSJ9Cg==(/figmeta)-->"></span><span data-buffer="<!--(figma)(/figma)-->"></span><span style="white-space-collapse: preserve;">Nuestro laboratorio cuenta con equipamiento de última generación que responde a estrictas normas de calidad y se encuentran al servicio de nuestros clientes.<br><br>Asimismo, contamos orgullosamente con un equipo de profesionales con amplia y destacada experiencia en el desarrollo de productos dirigidos al cuidado de la salud y cosmética capaz de interpretar y entender las necesidades de cada cliente de modo de acompañarlos y sugerirles las mejores alternativas de solución en productos de calidad, rentables y acordes a los lineamientos requeridos.</span><br></p>', 'fotos/wBKF74ltkSaoIZT43TGi1bKH09HNrNcfLS12q4Qx.jpg', 'fotos/OTTnJeAtU7hcmDuR4U7wMugawafXgXY1cV6OmUFe.txt', 'fotos/dww3d4lJILezUvsI4YqmlLCftrcxQL1rXjfLXL9w.jpg', 'calidad', '2024-05-29 19:12:57');

